import React, { Component } from 'react';
import { Button, Container, Grid } from 'semantic-ui-react';

class App extends Component{

    render(){
        return(
            <Container fluid>
                <link rel="stylesheet" href="//cdn.jsdelivr.net/npm/semantic-ui@2.4.2/dist/semantic.min.css" />
                <h2>Edu-ledger</h2>
                <Grid columns={3} divided>
                    <Grid.Row>
                        <Grid.Column>
                            <Button primary>Student</Button>
                        </Grid.Column>
                        <Grid.Column>
                            <Button primary>College</Button>
                        </Grid.Column>
                        <Grid.Column>
                            <Button primary>Bank</Button>
                        </Grid.Column>
                    </Grid.Row>
                </Grid>
            </Container>
        )
    };
}

export default App;
